import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";



function App(){
    return (
      <div>
      <Header />
        {notes.map(function createNote(noteitem){
  return (
    <Note 
      key={noteitem.key}
      Title={noteitem.title}
      Content={noteitem.content}
    />
  );
})}
      <Footer />
      </div>
    );
}

export default App;
